window.bookSummaryJSON = "<p><b><i>Zero Zero</i></b><b> is book number 11 in the number-one best-selling Agent Zero series, which begins with </b><b><i>Agent Zero</i></b><b> (Book One), with nearly 300 five-star reviews. </b></p> <p>When Agent Zero visits his doctor in Switzerland, hoping to salvage his deteriorating health, he is met with a shocking surprise: another agent who has been given a memory implant, just like him. And, just like him, this agent has deadly skills - and a singular mission: to kill Agent Zero. </p> <p>Agent Zero has met his doppelganger, a darker version of himself. </p> <p>Who is he? Who does he work for? Who chipped him? What secrets does he hold about Zero’s past? And why does he want Zero dead? </p> <p><i>Zero Zero</i> (Book 11) is an unputdownable espionage thriller that will keep you listening late into the night.</p>"; 
